import React, { Component, useState } from 'react';
import { Text,StyleSheet, TouchableOpacity, ToastAndroid, Platform, AlertIOS, View } from 'react-native';
import { Container, Header, Left, Body, Right, Button, Icon, Title, Item, Input } from 'native-base';
import ImageView from "react-native-image-viewing";
import FBCollage from 'react-native-fb-collage';



const images = [
  {
    uri: "https://images.unsplash.com/photo-1571501679680-de32f1e7aad4",
  },
  {
    uri: "https://images.unsplash.com/photo-1573273787173-0eb81a833b34",
  },
  {
    uri: "https://images.unsplash.com/photo-1569569970363-df7b6160d111",
  },
];

export default class Misc extends Component {

  constructor(props){
    super(props);
    this.state={
      visible: false,
      setIsVisible: false
    }
  }

    searchPage(){
        if(Platform.OS === 'android'){
            ToastAndroid.show("Search Page Navigation", ToastAndroid.SHORT)
        }
        else if(Platform.OS === 'ios'){
            AlertIOS.alert('Search Page Navigation');
        }
        else if(Platform.OS === 'web'){
            alert('Search Page Navigation');
        }
    }

  render() {
    return (
      <View 
      style={{ 
          flex: 1, 
          justifyContent: "center" 
      }}
  >
      <FBCollage 
        images={[
            // static image using require.
            //require('../assets/image-file.ext')
            //OR
            //fetch from server using url.
            //'https://imageURL...'
            //for Example
            'https://www.inovex.de/blog/wp-content/uploads/2018/03/react-native-800x450.png',

        ]}
        imageOnPress={() => {}}
      />
  </View>
    );
  }
}



const styles = StyleSheet.create({
    headerColor: {
        backgroundColor: 'white',
        padding: 20
    },
    textColor: {
        color: 'black'
    }
});
